import React from "react";
import Flag from "react-world-flags";
import { useParams, Link } from "react-router-dom";
import YoutubeValidation from "./YoutubeValidation";
import TwitterValidation from "./TwitterValidation";
import TweetsValidés from "./TweetsValidés";
import YoutubeValidés from "./YoutubeValides";
import ProjectValidation from "./ProjectValidation";
import TableProject from "components/aidchannel/webmaster/TableProject";

const ValidationProjects = (props) => {
  const { codeCountry, multimedia } = useParams();

  return (
    <div>
      <div className="container">
        <>
          <h1>
            <Flag
              code={codeCountry}
              height="70"
              width="70"
              style={{ marginRight: "2px" }}
              className="flag"
            />{" "}
            Validation Projects
          </h1>
          <ul className="nav nav-tabs">
            <li className="nav-item">
              <Link
                to={`/web-master/projects/${codeCountry}`}
                className={`nav-link ${multimedia === "projects valides" &&
                  "active"}`}
              >
                Projects Valides
              </Link>
            </li>
            <li className="nav-item">
              <Link
                to={`/web-master/validation/youtube/${codeCountry}`}
                className={`nav-link ${multimedia === "projects non valides" &&
                  "active"}`}
              >
                Projects non valides
              </Link>
            </li>
          </ul>
        </>
        {multimedia === "projects valides" && <TableProject />}
        {multimedia === "projects non valides" && <TableProject />}
      </div>
    </div>
  );
};

export default ValidationProjects;
